css:
.panel {
  border-radius: 0;
  border: none;
  background-color: transparent;
  box-shadow: none;
}
.panel.bordered .panel-heading {
  border-radius: 2px 2px 0 0;
}
.inset-panel .panel-heading {
  border-radius: 2px 2px 0 0;
}
.panel-heading {
  margin: 0;
  border-radius: 0;
  font-size: 11px;
  line-height: 1;
}
.panel-heading .btn {
  height: 20px;
  line-height: 20px;
  font-size: 9px;
  position: relative;
  top: -5px;
}
